import React from "react";
import CloseIcon from "../images/closeicon.png";

function EmployeeView() {
	return (
		<div className='emp-view-card'>
			<button>
				<img src={CloseIcon} className='closeicon' />
			</button>
		</div>
	);
}

export default EmployeeView;
